:{}',1466654107,NULL),(154,36,2,3,'Здравствуйте! Чем я могу Вам помочь?','','a:0:{}',1466654115,'Lyazzat Undirbekova'),(155,36,1,0,'Добрый день. Мы хотим принять участие в объявленном тендере. Брокер-инициатора ТОО \"FB Capital\"\n','','a:0:{}',1466654192,'Посетитель'),(156,36,1,0,'вопрос такой, мы должны пользоваться услугами только данного брокера ТОО \"FB Capital\"?\n\n','','a:0:{}',1466654227,'Посетитель'),(157,36,2,3,'В случаи если ТОО \"FB Capital\" является брокером Инициатора, то необходимо обратиться к услугам другого брокера имеющего доступ к торгам в Секции торговли специализированными товарами. Так как согласно Типовых правил биржевой торговли брокер не может представлять интересы как Инициатора так и Поставщика.\n','','a:0:{}',1466654487,'Lyazzat Undirbekova'),(158,36,2,3,'Контакты брокеров опубликованы на сайте www.ets.kz  в разделе Члены биржи.','','a:0:{}',1466654527,'Lyazzat Undirbekova'),(159,36,1,0,'странно они нам говорят, что они могут представлять наши интересы. Даже договор прислали на оказание услуг.\n\n','','a:0:{}',1466654602,'Посетитель'),(160,36,2,3,'а кто является Инициатором аукциона в котором Вы хотите принять участие?','','a:0:{}',1466654665,'Lyazzat Undirbekova'),(161,36,1,0,'Объявление аукциона http://fs.ets.kz/f/4664/prilozhenija-43-bayken.pdf назначенного на 1 июля 2016 года. Брокер-инициатора ТОО \"FB Capital\". Инициатор аукциона - ТОО «Байкен-U»','','a:0:{}',1466654718,'Посетитель'),(162,36,2,3,'Все верно, в данном аукционе ТОО \"FB Capital\" представляет интересы Инициатора, соответственно он не может представлять интересы Поставщика. Предлагаю поговорить с ними для разъяснения ситуации.','','a:0:{}',1466654827,'Lyazzat Undirbekova'),(163,36,1,0,'хорошо, то есть мне из списка брокеров надо выбрать, кто будет представлять наши интересы ','','a:0:{}',1466654885,'Посетитель'),(164,36,2,3,'да из списка брокеров, кто имеет доступ именно к Секции торговли специализированными товарами. ','','a:0:{}',1466654962,'Lyazzat Undirbekova'),(165,36,1,0,'Мы как юр. лицо, можем получить лицензию брокерскую, чтобы участвовать без посредников?','','a:0:{}',1466655038,'Посетитель'),(166,36,3,0,'Посетитель закрыл окно диалога','','a:0:{}',1466655250,NULL),(167,36,2,3,'Если Вы в форме ТОО или АО, и имеете лицензию на занятие брокерской и дилерской деятельностью, то можно подать документы для рассмотрения чтобы стать Членом нашей биржи\n','','a:0:{}',1466655395,'Lyazzat Undirbekova'),(168,36,2,3,'на нашем сайте в разделе !Как начать торговать\" опубликована пошаговая схема и ссылки на страницу со списком необходимых документов.','','a:0:{}',1466655457,'Lyazzat Undirbekova'),(169,36,6,0,'Оператор Lyazzat Undirbekova покинул диалог','','a:0:{}',1466655482,NULL),(170,37,3,0,'Посетитель пришел со страницы https://kc-ets.kz/qanda_ets.php\nhttp://ets.kz/ru/members.aspx','','a:0:{}',1466740805,NULL),(171,37,4,0,'Пожалуйста, подождите немного, к Вам присоединится оператор..','','a:0:{}',1466740805,NULL),(172,37,6,0,'Оператор Lyazzat Undirbekova включился в разговор','','a:0:{}',1466740856,NULL),(173,37,2,3,'Здравствуйте! Чем я могу Вам помочь?','','a:0:{}',1466740862,'Lyazzat Undirbekova'),(174,37,1,0,'Добрый день.\nУ меня вопрос, если я не успел сдать документы брокеру Заказчика, до 9.30, по причине того, что они приходят на работу к 10.00. Я могу с этим что ни будь сделать?\n\n','','a:0:{}',1466741032,'Посетитель'),(175,37,2,3,'Согласно регламента торгов время на подачу заявок от Поставщиков дается 4 рабочих дня, необходимо придерживаться указанных сроков, вплоть до времени указанного в нем. О каком брокере идет речь, чтобы мы могли учесть Ваше замечания касательно начала рабочего времени брокера?','','a:0:{}',1466741279,'Lyazzat Undirbekova'),(176,37,1,0,'ТОО FB Capital ','','a:0:{}',1466741322,'Посетитель'),(177,37,1,0,'Согласно регламента торгов время на подачу заявок от Поставщиков дается 4 рабочих дня. Мы получили рассылку с объявлением, о том что объявлен Аукцион  \n\"do-not-reply@ets.kz\" <do-not-reply@ets.kz